import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Register from './Register';
import Nav from './Nav';
import EventPage from './EventPage';
import { UserProvider } from './UserContext'; // Make sure the path is correct
import NewEvent from './NewEvent';
import PastEvents from './PastEvents';

function App() {
  const addToCart = (eventData) => {
    console.log('Added to Cart:', eventData);
    // Add logic to update the cart state or perform other actions
  };

  return (
    <Router>
      <UserProvider>
        {/* Nav should be part of the layout and not a route */}

        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/eventpage" element={<EventPage addToCart={addToCart} />} />
          <Route path="/pastevents" element={<PastEvents />} />
          <Route path="/newevent" element={<NewEvent />} />
        </Routes>
      </UserProvider>
    </Router>
  );
}

export default App;
